import './App.css';
import React, { Fragment } from 'react';
import Card from './Card';
import { Order } from './Order';


function App() {
  const arr = Order;
  return (
    <>
    <div className = 'row md-4'>
    {arr.map((item , index) => (
      <Card key = {index} name = {item.food_name} price = {item.price} status = {item.status} image = {item.image}/>
    ))}
     <Card />
     <Order />
    </div>
    </>
);
}

export default App;
